import React from "react";
import Post from "./components/Post.jsx";

async function fetchPosts() {
  let posts = await fetch('https://listnotes.forgiveandforget.workers.dev/')
  return posts.json()
}

function List() {
  let sposts = fetchPosts();
  return (
    <ul contentEditable="true" spellCheck="false">
      posts.map(<Post />)
    </ul>
  );
}

export default List;
